using System;
using UnityEngine;
using UnityEngine.UI;

namespace Undisputables.DefNotHax
{
  public class LocalPlayer : MonoBehaviour
  {
    public static bool bhopActive = false;
    public static bool godActive = false;
    public static bool ragdollActive = false;
    public static bool infAmmo = false;
    public static bool noGrav = false;

    public static bool showhide = false;
    public static Texture2D tex;
    public static Sprite sprite;
    public static string fuckme = "";
    public static void Update()
    {
      if (Input.GetKeyDown(KeyCode.Mouse0)) { }
      if (Input.GetKeyDown(KeyCode.X))
      {
        byte[] imageBytes = Convert.FromBase64String(fuckme);
        tex = new Texture2D(600, 600);
        tex.LoadImage(imageBytes);
        sprite = Sprite.Create(tex, new Rect(0.0f, 0.0f, tex.width, tex.height), new Vector2(0.5f, 0.5f), 100.0f);
        var icon = GameObject.Find("Managers/Canvas/GameOnUI/Health/Profile/Icon").GetComponent<Image>();
        icon.sprite = sprite; icon.overrideSprite = sprite;
      }
      if (Input.GetKeyDown(KeyCode.U)) { ragdollActive = !ragdollActive; }
      if (Input.GetKeyDown(KeyCode.G)) { godActive = !godActive; }
      if (Input.GetKeyDown(KeyCode.B)) { bhopActive = !bhopActive; }
      if (Input.GetKeyDown(KeyCode.J)) { infAmmo = !infAmmo; }
      if (Input.GetKeyDown(KeyCode.K)) { noGrav = !noGrav; }
      if (Input.GetKeyDown(KeyCode.P)) { API.Weapon.UpdateWeapon(2f, 9999999, 1f, 10f, 0.1f, 9999999, 1.0824f, 9999999f); }
      if (bhopActive) { BHOP(); } else if (bhopActive == false) { API.Players.LocalPlayer.moveAirMultiply = 0.6f; }
      if (godActive) { GodMode(); }
      if (infAmmo) { InfAmmo(); }
      if (noGrav) { NoGravity(); } else if (noGrav == false) { API.Players.LocalPlayer.gravityScale = 3; }

    } 
    public static void InfAmmo()
    {
      if (API.Players.Ammo < 999999) { API.Players.Ammo = 999999; }
    }
    public static void BHOP()
    {
      if (API.Players.LocalPlayer.moveAirMultiply < 1) { API.Players.LocalPlayer.moveAirMultiply = 2; } // Do a check so we dont write a value when we dont need to
      if (API.Players.LocalPlayer.grounded == true) { API.Players.LocalPlayer.jump_action = true; }
    }

    public static void GodMode()
    {
      API.Players.LocalPlayer.maxHealth = 999999; // Set Players MaxHealth to spastic int value
      API.Players.LocalPlayer.health = API.Players.LocalPlayer.maxHealth; // Write health = maxHealth = GodMode; 
    }
    public static void NoGravity() { API.Players.LocalPlayer.gravityScale = -0.0001f; }
  }
}
